import { defineStore } from 'pinia'

export const useSnackBar = defineStore('snackBar', {
  state() {
    return {
      show: false
    }
  },

  actions: {
    increment(value) {
      this.$state.layout = value
    }
  },

  getters: {
    showSnackBar() {
      return this.show
    }
  }
})
